BeaglePlug is the ultimate app for your e-mobility needs.
Wherever you are: at home, at work or on the road, with BeaglePlug you can find the best charging station and reach any destination.

How does it work? It’s very simple: Download the App for free and now you can:
• Easily find the charging station nearest you;
• Book an available socket and start the navigator to reach it;
• Monitor the charging and stop it once the necessary energy has accumulated;
• Easily pay via the App, by credit card or wallet;
• Request the Card for offline payments, without the need for a smartphone;
• Check the history of your refills and the respective costs at any time;
• Read reviews about other users' charging stations, and leave yours.

Don’t you still have a charging station at home?
Contact us and you will have the opportunity to test and manage with BeaglePlug even your personal charging station, in a smart way and at no extra cost to your electricity manager.

Let the BeaglePlug app become your most beneficial tool for electric driving.
Join us to observe our world with an unprecedented and revolutionary look.
